import React from 'react';
import '../styles/components.css';

const Projects = () => {
    const projectList = [
        {
            title: 'Project One',
            description: 'A brief description of the project, highlighting key features and technologies used.',
            link: 'https://example.com/project-one'
        },
        {
            title: 'Project Two',
            description: 'Another exciting project that showcases my skills in web development.',
            link: 'https://example.com/project-two'
        },
        {
            title: 'Project Three',
            description: 'A personal project that demonstrates my passion for coding and design.',
            link: 'https://example.com/project-three'
        }
    ];

    return (
        <section className="projects" id="projects">
            <h2>Projects</h2>
            <ul>
                {projectList.map((project, index) => (
                    <li key={index}>
                        <h3>{project.title}</h3>
                        <p>{project.description}</p>
                        <a href={project.link} target="_blank" rel="noopener noreferrer">View Project</a>
                    </li>
                ))}
            </ul>
        </section>
    );
};

export default Projects;
